      SELECT + 30 AS col1 FROM tab0 (FORMAT parquet) WHERE ( - CAST ( NULL AS REAL ) * - col0 * col1 * + col0 * + - col2 ) NOT BETWEEN col1 * + 68 AND NULL;
  - name: tab0

outputs:
  - name: q12449.out
    data: |
